import React from 'react';
import Routes from '../routes';

import { Provider } from 'react-redux';
import {store} from '../store/configureStore';

const Root = ({ store }) => ( // eslint-disable-line react/prop-types
  <Provider store={store}>
    <Routes />
  </Provider>
);

export default Root;
